import React from 'react';
import "./Socials.css"; 

function Socials(){

    return(
        <div>
        <h1>Socials</h1>
        <img className="image1" src="https://cdn-icons-png.flaticon.com/512/25/25231.png" width="20"/>
        <img className="image2" src="https://iconape.com/wp-content/files/yd/367773/svg/logo-linkedin-logo-icon-png-svg.png" width="300"/>
        </div>
    );
}


export default Socials;
